import React from 'react'
import { useParams } from 'react-router-dom'

function Loginpage() {
  const {allentry}=useParams()
  return (
    <div>
      <h1>welcome</h1>
      <div>
      {
          allentry.map((e)=>{
          return(
              <div>
              <p>{e.email}</p>
              <p>{e.password}</p>
              </div>    
              )})
      }
      </div>
      <h1>{allentry}</h1> 
      </div>
  )
}

export default Loginpage
